candidate_text:
Here’s how it works: The MiniMed 670G system consists of three components:
A continuous glucose monitor (CGM) that tracks glucose levels throughout the day and night;
An insulin pump that delivers basal insulin (background insulin);
And an automated controller that uses data from the CGM to adjust insulin doses.

Here’s how it works: The system consists of three components:
A continuous glucose monitor (CGM) that tracks glucose levels throughout the day and night;
An insulin pump that delivers basal insulin (background insulin);
And a controller that makes adjustments to insulin delivery based on CGM data.

The system includes several features designed to make life easier for users, including:
A touchscreen interface that makes it easy to navigate and adjust settings;
Real-time glucose data and trends displayed on the pump;
Automatic basal rate adjustments based on glucose levels;
Optional alerts and alarms to notify users of high or low glucose levels; and,
Integration with Medtronic’s CareLink software, allowing healthcare providers to remotely access patient data and provide more personalized care.
